"""
Write an efficient algorithm that searches for a value in an m x n matrix. This matrix has the following properties:

Integers in each row are sorted in ascending from left to right.
Integers in each column are sorted in ascending from top to bottom.
For example,

Consider the following matrix:

[
  [1,   4,  7, 11, 15],
  [2,   5,  8, 12, 19],
  [3,   6,  9, 16, 22],
  [10, 13, 14, 17, 24],
  [18, 21, 23, 26, 30]
]
Given target = 5, return true.

Given target = 20, return false.
"""


class Solution(object):
    # def searchMatrix_3(self, matrix, target):
    def searchMatrix(self, matrix, target):
        for i in range(len(matrix)):
            L = 0
            R = len(matrix[i]) - 1
            while L <= R:
                mid = L + (R - L) // 2
                if matrix[i][mid] == target:
                    return True
                elif matrix[i][mid] < target:
                    L = mid + 1
                else:
                    R = mid - 1
        return False

    def searchMatrix_2(self, matrix, target):
    # def searchMatrix(self, matrix, target):
        if len(matrix) == 0:
            return False
        row_len = len(matrix[0])
        _len = len(matrix) * row_len
        if _len == 1:
            if matrix[0][0] == target:
                return True
            return False

        L = 0
        R = _len - 1
        while L <= R:
            l_row = L // row_len
            l_col = L % row_len
            l_val = matrix[l_row][l_col]

            r_row = R // row_len
            r_col = R % row_len
            r_val = matrix[r_row][r_col]

            M = L + (R - L) // 2
            m_row = M // row_len
            if M % (row_len - 1) == 0:
                if matrix[m_row][0] <= target:
                    M + 1
            m_col = M % row_len
            m_val = matrix[m_row][m_col]
            # if l_val > r_val:


            print(f'left: {l_val}')
            print(f'right: {r_val}')
            print(f'mid: {m_val}')
            print()
            if m_val == target:
                return True
            elif m_val > target:
                R = M - 1
            else:
                L = M + 1
        return False




    def searchMatrix_BRUTE(self, matrix, target):
    # def searchMatrix(self, matrix, target):
        """
        :type matrix: List[List[int]]
        :type target: int
        :rtype: bool
        """
        if len(matrix) == 0:
            return False
        _len = len(matrix) * len(matrix[0])
        if _len == 1:
            if matrix[0][0] == target:
                return True
            return False
        lst = []
        for row in matrix:
            lst += row
        lst.sort()

        L = 0
        R = _len - 1
        while L <= R:
            mid = L + (R - L) // 2
            if lst[mid] == target:
                return True
            elif lst[mid] > target:
                R = mid - 1
            else:
                L = mid + 1
        return False


